import Logf from "../../Assets/Logo";
import styles from './Footer.module.css'

const Footer = () => {
  return (
    <>
      <p1>Looking to create a page for a business? Get help</p1>
      <p className={styles.p}>
        <Logf/> Â© 2021 <a>About</a> <a>Accessibility</a> <a>User Agreement</a> <a>Privacy Policy</a>
        <a>Cookie Policy</a> <a>Copyright Policy</a> <a>Brand Policy</a> <a>Guest Controls</a> <a>Community
        Guidelines</a>
      </p>
    </>
  );
};
export default Footer;
